def open_file_dialog():
    filetypes = (
        ('xlsx files', '*.xlsx'),
        ('xls files', '*.xls'),
        ('All files', '*.*')
    )
    filename = filedialog.askopenfilename(
        title='Open a file',
        initialdir=current_file_path,
        filetypes=filetypes)
    if filename:
        global input_file_path
        input_file_path = filename
        file_name_with_ext = os.path.basename(filename)
        file_name_without_ext = os.path.splitext(file_name_with_ext)[0]
        label1.config(text = file_name_without_ext)
        print_message("已选择 " + file_name_with_ext)
        filter_button.configure(state='normal')
    else:
        print_message("取消选择")

open_button=ttk.Button(frame,text='选择文件',command=open_file_dialog)

def group_filter():
    if label1['text'] == "未选择" or entry_column_header.get() == '' or entry_sheet.get() == '' or entry_row.get() == '':
        print_message("未满足运行条件")
        return
    filter_button.configure(state='disabled')
    row = 'A' + entry_row.get()
    sheet_name = entry_sheet.get()
    column_header = entry_column_header.get()
    if not copy_workbook(sheet_name):
        filter_button.configure(state='normal')
        return
    app = xw.App(visible = True, add_book = False)
    workbook = app.books.open(out_file_path)
    worksheet = workbook.sheets[sheet_name]
    value = worksheet.range(row).options(pd.DataFrame, header = 1, index = False, expand = 'table').value
    try:
        data = value.groupby(column_header)
    except KeyError:
        print_message(f"<{column_header}> 不存在")
        print_message("请检查工作表信息是否正确")
        workbook.close()
        app.quit()
        filter_button.configure(state='normal')
        return
    old = ""
    for idx, group in data:
        if old == "":
            old = idx
        elif old != idx:
            print_message(old + " --- 已完成")
            old = idx
        new_worksheet = workbook.sheets.add(idx)      # 在工作簿中新增工作表并命名为当前的产品名称
        new_worksheet['A1'].options(index = False).value = group      # 将数据添加到新增的工作表
    workbook.save()
    print_message("执行完毕！")
    print_message(out_file_path)
    filter_button.configure(state='normal')
    #workbook.close()
    #app.quit()
def start_thread():
    thread = threading.Thread(target=group_filter)
    thread.start()
filter_button=ttk.Button(frame,text='分组',command=start_thread)

