def copy_workbook(sheet_name):
    now = datetime.datetime.now()
    filename = now.strftime("%Y-%m-%d_%H-%M-%S") + '.xlsx'
    global out_file_path
    out_file_path = current_file_path + '\\' + filename
    source_wb = openpyxl.load_workbook(input_file_path)
    sheet_to_copy = source_wb[sheet_name]
    new_wb = openpyxl.Workbook()
    new_sheet = new_wb.active
    for row in sheet_to_copy.iter_rows(values_only=True):
        new_sheet.append(list(row))
    new_sheet.title = sheet_to_copy.title
    try:
        new_wb.save(out_file_path)
        os.chmod(out_file_path, 0o777)
    except IOError:
        print_message("目标文件正在被使用,关闭后重试")
        return False
    source_wb.close()
    return True
def print_message(*args):
    message = '\n'.join(args)
    scrolled_text.insert('end', message + '\n')
    scrolled_text.see('end')  # Scroll to the end of the text

